ProductPageQuery.query:
query ProductPageQuery($id: String!) {
  site {
    siteMetadata {
      title
      description
      titleTemplate
      siteUrl
    }
  }
  product: storeProduct(id: {eq: $id}) {
    id: productID
    slug
    seo {
      title
      description
    }
    brand {
      name
      brandName: name
    }
    sku
    gtin
    name
    description
    breadcrumbList {
      itemListElement {
        item
        name
        position
      }
    }
    image {
      url
      alternateName
    }
    offers {
      lowPrice
      highPrice
      priceCurrency
      offers {
        price
        priceValidUntil
        priceCurrency
        availability
        itemCondition
        seller {
          identifier
        }
        listPrice
      }
    }
  }
}

