FullTextSearchQuery.query:
query FullTextSearchQuery($first: Int!, $after: String, $sort: StoreSort, $term: String!, $selectedFacets: [StoreSelectedFacet!]!) {
  search(
    first: $first
    after: $after
    sort: $sort
    term: $term
    selectedFacets: $selectedFacets
  ) {
    products {
      pageInfo {
        totalCount
      }
      edges {
        node {
          id: productID
          slug
          name
          brand {
            brandName: name
          }
          isVariantOf {
            name
          }
          image {
            url
            alternateName
          }
          offers {
            lowPrice
            offers {
              price
              listPrice
              seller {
                identifier
              }
            }
          }
        }
      }
    }
    facets {
      key
      label
      type
      values {
        label
        value
        selected
        quantity
      }
    }
  }
}

